import React from 'react';

export default function Course(props) {
    return (
        <>
            <div
                className="cs-course"
                style={{
                    //'--minute' : props.course['time']['start']['minute'],
                    zIndex     : props.index
                }}>

                {props.course['course']}
            </div>
        </>
    );
}
